import { Container, Grid, Typography } from "@mui/material";

const immagini = [
  {
    src: "/client-app/public/img/vol1.jpg",
    titolo: "Distrubuzione a Sesto San Giovanni",
  },
  { src: "/client-app/public/img/vol2.jpg", titolo: "Distrubuzione a Milano" },
  { src: "/client-app/public/img/vol3.jpg", titolo: "Distrubuzione a Milano" },
  { src: "/client-app/public/img/vol4.jpg", titolo: "Distrubuzione a Milano" },
  { src: "/client-app/public/img/vol5.jpg", titolo: "Distrubuzione a Milano" },
  { src: "/client-app/public/img/vol6.jpg", titolo: "Distrubuzione a Milano" },
];

export default function Galleria() {
  return (
    <Container sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        Galleria fotografica
      </Typography>

      <Grid container spacing={3}></Grid>
    </Container>
  );
}
